import React from "react";
import styled from "styled-components";
import { RiLock2Fill } from "react-icons/ri";
import { SiCashapp } from "react-icons/si";
import { Button } from "react-bootstrap";

const LoginPage = () => {
  let clientScreenHeight = document.documentElement.clientHeight;

  let LoginHead = styled("p")`
    font-size: 48px;
    width: 300px;
    border-bottom: 2px solid #2d4059;
  `;

  let Label = styled("span")`
    font-size: 48px;
  `;

  return (
    <div>
      <div className="container" style={{ position: "relative" }}>
        <div style={{ position: "absolute", top: "80px", left: "80px" }}>
          <SiCashapp
            style={{ color: "#EA5455", fontSize: "70px", margin: "0 20px" }}
          />
        </div>
        <div className="row">
          <div
            className="col d-flex flex-column justify-content-center align-items-center"
            style={{ paddingTop: "80px" }}
          >
            <LoginHead>Login</LoginHead>
            <p>
              <RiLock2Fill style={{ fontSize: "48px" }} />
            </p>
            <p
              style={{
                display: "flex",
                width: "600px",
                alignItems: "center",
                paddingTop: "80px",
                justifyContent: "space-between",
              }}
            >
              <Label>ID</Label>
              <input
                type="text"
                placeholder="아이디를 입력하세요"
                style={{ width: "500px", height: "50px" }}
              />
            </p>
            <p
              style={{
                display: "flex",
                width: "600px",
                alignItems: "center",
                paddingTop: "30px",
                justifyContent: "space-between",
              }}
            >
              <Label>PW</Label>
              <input
                type="password"
                placeholder="비밀번호를 입력하세요"
                style={{ width: "500px", height: "50px" }}
              />
            </p>
            <p>
              <Button>로그인</Button>
              <Button>회원가입</Button>
              <Button>계정찾기</Button>
            </p>
          </div>
        </div>
      </div>
    </div>
  );
};

export default LoginPage;
